#witr #3rakatwitr #witrnamaz
Witr is important Wajab Prayers (Salah, Namaz). There are two mustanat (agreed upon) ways of it in the sunnah, praying 3 Rakat in two parts (2 1) or together. In this video, we look at the first methods. The references to both are provided in discloser at the start of the video. @ZillNoorain https://zillnoorain.com/ 
